export async function postBatch (batch) {
  for (let i = 0; i < batch.length; i++) {
    const jwt = batch[i]

    const txId = await interactWrite(arweave, devWallet, PROD_CONTRACT_ID, jwt)
    console.log(`Posted ${txId} for jwt #${i}`)
  }
}

